#include<vector>//bruteforce method
using namespace std;
int longestOnes(vector<int>& nums, int k) {
    int n=nums.size();
    int ans=0,sum=0;
    int idx=k;
    int i=0;
    while(i<n-k+1){
        int m=0;
        int a=i;
        while(a<n){
            if(nums[a]==0){
                m+=1;
                if(m>k) break;
                else sum+=1;
            }
            else sum+=nums[a];
            a++;
        }
        i++;
        // cout<<sum<<endl;
        if(ans<sum) ans=sum;
        sum=0;
    }
    return ans;
} 
